(1, 'help', '\"Help\" Options:<br>\r\nFollow and type the correct command to remove some error\'s encountered! <br><br>\r\n\r\n► \"reset\" - To refresh page.<br>\r\n► \"dep\" - To view all department.<br>\r\n► \"depNumber\" - To select items.<br>', 0, 0),
