(7, 'dep2', 'DEP: ► Student Portal Enter command:<br> \n\"sp1-4\" <br><br>\n\n<a>Select Options:</a><br><br>\n<a class=\"rep\" href=\"#\"> [sp1] No Grades </a> <br> \n<a class=\"rep\" href=\"#\"> [sp2] Update balance </a> <br> \n<a class=\"rep\" href=\"#\"> [sp3] Can\'t Login </a> <br> \n<a class=\"rep\" href=\"#\"> [sp4] Other\'s </a> <br>', 0, 0),
